sys_variable_value.value:
(function execute(inputs, outputs) {
	inputs = new MicrosoftDynamicsCRMUtils().trimStringInputs(inputs);
	outputs.entity_type = new MicrosoftDynamicsCRMUtils().toLowerCase(inputs
		.entity_type);
	if (inputs.list_mandatory_fields == "true" || inputs
		.list_mandatory_fields == "false")
		outputs.list_mandatory_fields = inputs.list_mandatory_fields;
	else
		new MicrosoftDynamicsCRMUtils().throwError(
			"invalid_list_mandatory_field");

})(inputs, outputs);

