sys_variable_value.value:
(function execute(inputs, outputs) {
	if (inputs.status_code == "200") {
		outputs.status = "Success";
		var response = JSON.parse(inputs.response);
		var bindJson = JSON.parse(inputs.bindjson);
		var fields = {
			data: []
		};
		var payload = response.value;
		payload.map(function(json) {
			var type = new MicrosoftDynamicsCRMUtils().getType(
			json);
			if (type == "picklist") {
				fields.data.push({
					name: json.LogicalName,
					label: new MicrosoftDynamicsCRMUtils()
						.getDisplayName(json),
					value: " ",
					type: "choice",
					choices: new MicrosoftDynamicsCRMUtils()
						.getPicklistOptions(inputs
							.picklistjson, json.LogicalName)
				});
			} else if (type == "lookup") {
				var bindname = new MicrosoftDynamicsCRMUtils()
					.getBindName(bindJson, json.Targets[0]);
				if (json.AttributeType != "Lookup") {
					fields.data.push({
						name: json.LogicalName + '_' + json
							.Targets[0] + '@odata.bind-' +
							bindname,
						label: new MicrosoftDynamicsCRMUtils()
							.getDisplayName(json),
						value: " ",
						type: "string"
					});
				} else {
					fields.data.push({
						name: json.LogicalName +
							'@odata.bind-' + bindname,
						label: new MicrosoftDynamicsCRMUtils()
							.getDisplayName(json),
						value: " ",
						type: "string"
					});

				}
			} else {
				fields.data.push({
					name: json.LogicalName,
					label: new MicrosoftDynamicsCRMUtils()
						.getDisplayName(json),
					value: " ",
					type: "string"
				});
			}
			if(inputs.list_mandatory_fields == "false"){
				fields = new MicrosoftDynamicsCRMUtils()
					.spliceMandatoryKeys(fields, inputs.entity_type);
            }
			outputs.tables = fields;
		});
	} else
		outputs = new MicrosoftDynamicsCRMErrorHandler()
		.getEntityMetadataErrorHandler(inputs, outputs);
})(inputs, outputs);

